import React from 'react';
import './Slide.css'
import images1 from '../../images/a.jpg'
import images2 from '../../images/b.jpg'
import images3 from '../../images/c.jpg'

const Slide = () => {
    return (
        <div id="slideshow-example" data-component="slideshow">
            <div role="list">
                <div className="slide">
                    <img src={images1} alt="" width="auto" height="500px" />
                </div>
                <div className="slide">
                    <img src={images2} alt="" width="auto" height="500px" />
                </div>
                <div className="slide">
                    <img src={images3} alt="" width="auto" height="500px" />
                </div>
            </div>
        </div>
    );
}

export default Slide;
